import React from 'react';
import '../../hojas-de-estilo/Tarjeta.css';
import Footer from '../../componentes/Footer.jsx';
import Header from '../../componentes/Header.jsx';
import { useState } from 'react';

function Tarjeta() {
    const [numtarjeta, setNumtarjeta] = useState ("Número de tarjeta");
    const [nyatarjeta, setNyatarjeta] = useState ("Nombre y apellido");
    const [fechatarjeta, setFechatarjeta] = useState ("Fecha de expira...");
    const [codtarjeta, setCodtarjeta] = useState ("Código de segu...");
    const [dnitarjeta, setDnitarjeta] = useState ("DNI del titular de la tarjeta");
    return (
        <div className='Tarjeta-todo'>
            <Header/>
            <p className='Ingrese-tarjeta'>Ingrese tarjeta Mercado Pago</p>
            <div className='Contenedor-tarjeta'>
              <input type ="text" className="numtarjeta" value = {numtarjeta} />
              <p className='Tt-linea1'></p>
              <input type ="text" className="nyatarjeta" value = {nyatarjeta} />
              <p className='Tt-linea2'></p>
              <input type ="text" className="fechatarjeta" value = {fechatarjeta} />
              <p className='Tt-linea3'></p>
              <input type ="text" className="codtarjeta" value = {codtarjeta} />
              <p className='Tt-linea4'></p>
              <input type ="text" className="dnitarjeta" value = {dnitarjeta} />
              <p className='Tt-linea5'></p>
              <img className="Imagen-mercadop"
                          src={require("../../imagenes/mercadopago.jpg")}
                          alt="Tarjeta de Mercado Pago"/>
            </div>
            <div className='Contenedor-lateral'>
              <img className="Imagen-libro-alice"
                          src={require("../../imagenes/libro-alice.png")}
                          alt="Tarjeta de Libro Alice"/>
              <p className="T-libro">Libro:</p>
              <p className="T-autor">Autor:</p>
              <p className="T-coleccion">Coleccion:</p>
              <p className='T-linea1'></p>
              <p className="T-porductos">Producto</p>
              <p className="T-cantidad">Cantidad</p>
              <p className="T-envios">Envío</p>
              <p className='T-linea2'></p>
              <p className="T-pagas">Pagás:</p>
            </div>
          <Footer/>
        </div>
    );
  }

  export default Tarjeta;
